import * as React from "react";
import { Alert, TouchableHighlight } from "react-native";
import { Button } from "react-native";
import { Image } from "react-native";
import { SafeAreaView, View } from "react-native";
import { TouchableOpacity } from "react-native";
import { StyleSheet, Text } from "react-native";
import { auth_logout } from "../Auth/AuthSlice";
import { useDispatch } from "react-redux";
const ProfileTab = ({ navigation }) => {
  const dispatch = useDispatch();
  const logoutHandler = () => {
    Alert.alert("Hold On", "Are you sure you want to logout?", [
      {
        text: "Cancel",
        onPress: () => null,
        style: "cancel",
      },
      {
        text: "YES",
        onPress: () => navigation.navigate("LogIn"),
      },
    ]);

    // dispatch(auth_logout());
    return true;
  };
  return (
    <SafeAreaView style={Styles.container}>
      <View style={Styles.headerContainer}>
        <View style={Styles.headerTopContainer}>
          <TouchableOpacity
            style={Styles.headerBtn}
            //  onPress={() => this.props.navigation.openDrawer()}
          >
            {/* <Octicons name="three-bars" size={28} color="white" /> */}
          </TouchableOpacity>
          <Text style={Styles.headerText}>User Profile</Text>
          <View style={Styles.headerIconContainer}>
            <TouchableOpacity style={Styles.headerBtn}>
              {/* <AntDesign name="setting" size={28} color="white" /> */}
            </TouchableOpacity>
          </View>
        </View>
        <View style={Styles.headerImageContainer}>
          <View style={Styles.ImageContainer}>
            <TouchableHighlight>
              <Image
                source={require("../../assets/muneeb.jpg")}
                style={Styles.Image}
              />
            </TouchableHighlight>
          </View>
        </View>
      </View>
      <View style={Styles.mainContent}>
        <View style={Styles.IdMain}>
          <View style={Styles.InvSpace}></View>
          <View style={Styles.IdDetails}>
            <Text
              style={{
                fontSize: 22,
                color: "black",
                marginTop: 60,
              }}
            >
              <Text style={{ fontWeight: "bold" }}>Name:</Text> Muneeb Ahmad
            </Text>
            <Text
              style={{
                fontSize: 22,

                color: "black",
                marginTop: 20,
              }}
            >
              <Text style={{ fontWeight: "bold" }}>Email:</Text>{" "}
              muneebahmad21423@gmail.com
            </Text>
            <Text
              style={{
                fontSize: 22,

                color: "black",
                marginTop: 20,
              }}
            >
              <Text style={{ fontWeight: "bold" }}>Phone Number:</Text>{" "}
              03004182695
            </Text>
            <Text
              style={{
                fontSize: 22,

                color: "black",
                marginTop: 20,
              }}
            >
              <Text style={{ fontWeight: "bold" }}>Orders:</Text> 3
            </Text>
            <Text
              style={{
                fontSize: 22,

                color: "black",
                marginTop: 20,
              }}
            >
              <Text style={{ fontWeight: "bold" }}>Pending Orders:</Text> 0
            </Text>
            <Text
              style={{
                fontSize: 22,

                color: "black",
                marginTop: 20,
              }}
            >
              <Text style={{ fontWeight: "bold" }}>Username:</Text>{" "}
              muneebahmad22
            </Text>
          </View>
        </View>
        <View style={Styles.logoutBtn}>
          <TouchableOpacity
            style={Styles.button}
            onPress={() => logoutHandler()}
          >
            <Text style={Styles.btn}> Logout </Text>
          </TouchableOpacity>
        </View>
      </View>
    </SafeAreaView>
  );
};
const Styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: "center",
    flexDirection: "column",
    marginTop: -69,
  },
  logoutBtn: {
    alignItems: "center",
